description:
The Best Of Ultravox is the seventh compilation by New Wave band Ultravox, released on EMI Gold records, in 2003, being one of the more recent compilation albums of the band. The songs of the disc are from the success era of the band, in the 1980s, while Midge Ure was the singer.

